<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8">
    <meta content="width=device-width, initial-scale=1, minimal-ui" name="viewport"/>
    <title>Seznam.cz Hackathon Brno 2021 &ndash; Performace results</title>
    <style>
      html,
      body,
      #graph {
        margin: 0;
        width: 100%;
        height: 100%;

        font: 100% sans-serif;

        overflow: hidden;
      }

      #graph {
        display: flex;

        flex-direction: row;
        justify-content: center;
      }

      #graph svg {
        width: 100vmin;
        height: 100vmin;
        max-width: 100%;
        max-height: 100%;

        flex: 0 1 0;
      }

      .legend {
        display: flex;

        margin: 0 1em 0 0;
        padding: 0;

        align-self: center;

        flex-direction: column;
        flex: 0 0 auto;

        list-style: none;
      }

      .legend li {
        display: flex;

        flex-direction: row;
        align-items: center;
      }

      .legend span {
        display: block;

        margin-right: 0.4em;
        width: 1em;
        height: 1em;

        background: currentColor;
      }

      @media (orientation: portrait) {
        #graph {
          flex-direction: column;
        }

        .legend {
          margin: 0 0 1em 0;

          flex-direction: row;
        }

        .legend li {
          margin-left: 1em;
        }

        .legend li:first-child {
          margin-left: 0;
        }
      }
    </style>
  </head>
  <body>
    <div id="graph"></div>

    <script src="https://cdn.jsdelivr.net/npm/d3@7.0"></script>
    <script type="module">
      const TEAM_IDS = [2, 3, 4]
      const TEAM_COLORS = {
        2: "#cc0000",
        3: "#00cc00",
        4: "#0000cc",
      }

      const teams = TEAM_IDS.map(id => ({
        id,
        entries: JSON.parse(document.getElementById(`team${id}`).innerText).map(
          (entry, index) => ({...entry, index})
        ),
        get values() {
          return this.entries.map(entry => entry.score)
        },
        get indexes() {
          return this.entries.map(entry => entry.index)
        },
      }))
      const allValues = teams.map(team => team.values).flat(1)
      const allIndexes = teams.map(team => team.indexes).flat(1)

      const legend = document.createElement('ul')
      legend.className = 'legend'
      for (const team of teams) {
        const teamLegend = document.createElement('li')
        const teamColor = document.createElement('span')
        teamColor.style.color = TEAM_COLORS[team.id]
        teamLegend.appendChild(teamColor)
        teamLegend.appendChild(document.createTextNode(`Team ${team.id}`))
        legend.appendChild(teamLegend)
      }
      document.getElementById('graph').appendChild(legend)
      
      const size = Math.min(window.innerWidth, window.innerHeight)
      const margin = {top: 10, right: 10, bottom: 30, left: 50}
      const svg = d3.create("svg")
          .attr("viewBox", [0, 0, size, size])
          .style("overflow", "visible")

      const x = d3.scaleLinear()
        .domain([0, Math.max(...allIndexes)])
        .range([margin.left, size - margin.right])
      const y = d3.scaleLinear()
        .domain([0, Math.max(...allValues)]).nice()
        .range([size - margin.bottom, margin.top])

      const yAxis = g => g
        .attr("transform", `translate(${margin.left},0)`)
        .call(d3.axisLeft(y))
        .call(g => g.select(".tick:last-of-type text").clone()
          .attr("x", 3)
          .attr("text-anchor", "start")
          .attr("font-weight", "bold")
          .text("Score")
        )

      const xAxis = g => g
        .attr("transform", `translate(0,${size - margin.bottom})`)
        .call(d3.axisBottom(x).ticks(size / 80).tickSizeOuter(0))
        .call(g => g.select(".tick:last-of-type text").clone()
          .attr("x", -14)
          .attr("y", -10)
          .attr("text-anchor", "start")
          .attr("font-weight", "bold")
          .text("Round")
        )

      svg.append("g")
          .call(xAxis)

      svg.append("g")
          .call(yAxis)

      const line = d3.line()
        .x(entry => x(entry.index))
        .y(entry => y(entry.score))

      for (const team of teams) {
        const path = svg.append("path")
            .datum(team.entries)
            .attr("fill", "none")
            .attr("stroke", TEAM_COLORS[team.id])
            .attr("stroke-width", 1.5)
            .attr("stroke-linejoin", "round")
            .attr("stroke-linecap", "round")
            .attr("d", line)

        // svg.call(hover, path)
      }

      document.getElementById('graph').appendChild(svg.node())
    </script>
